static inline int
cheriabi_dispatch_fill_uap(struct thread *td, int syscall, void *uap)
{

	if (syscall < 0 || syscall >= CHERIABI_SYS_MAXSYSCALL)
		return (ENOSYS);

	if (cheriabi_fill_uap_funcs[syscall] != NULL)
		return (cheriabi_fill_uap_funcs[syscall](td, uap));
	else
		return(ENOSYS);
}

